    /**
     * 公司下拉框改变时触发
     * @param {*} val 
     */
    changeSelect(val) {
      console.log(val)
      const allValues = [];
      // 保留所有值
      for (const item of this.companyList) {
        allValues.push(item.value);
      }
      // 用来储存上一次的值，可以进行对比
      const oldVal =
        this.oldSearchPlat.length === 1 ? this.oldSearchPlat[0] : [];
      // 若是全部选择
      if (val.includes("全部")) {
        this.searchCompany = allValues;
        this.multi_select_show_label = this.companyList[0].label;
      }
      // 取消全部选中 上次有 当前没有 表示取消全选
      if (oldVal.includes("全部") && !val.includes("全部")) {
        this.searchCompany = [];
        this.multi_select_show_label = "";
      }
      // 点击非全部选中 需要排除全部选中 以及 当前点击的选项
      // 新老数据都有全部选中
      if (oldVal.includes("全部") && val.includes("全部")) {
        const index = val.indexOf("全部");
        val.splice(index, 1); // 排除全选选项
        this.searchCompany = val;
        this.multi_select_show_label = val;
      }
      // 全选未选 但是其他选项全部选上 则全选选上 上次和当前 都没有全选
      if (!oldVal.includes("全部") && !val.includes("全部")) {
        if (val.length === allValues.length - 1) {
          this.searchCompany = ["全部"].concat(val);
          this.multi_select_show_label = this.companyList[0].label;
        } else {
          this.searchCompany = val;
          this.multi_select_show_label = val;
        }
      }
      // 储存当前最后的结果 作为下次的老数据
      this.oldSearchPlat[0] = this.searchCompany;
      // 数据处理
      this.multi_select_value = this.searchCompany;
      var multi_select_num = this.multi_select_value.length;
      if (this.multi_select_show_label == this.companyList[0].label) {
        this.multi_select_value = "";
        multi_select_num -= 1;
      } else {
        this.multi_select_value = this.multi_select_value.join(",");
      }
      this.$nextTick(function () {
        var multi_select_obj_arr = document.getElementsByClassName("el-select__tags-text");
        var multi_select_obj_length = multi_select_obj_arr.length;
        if (multi_select_obj_length >= 2) {
          var multi_select_obj = multi_select_obj_arr[multi_select_obj_length - 1];
          multi_select_obj.innerHTML = "" + multi_select_num;
        }
      });
    },

    /**
     * 下拉操作
     * @param {*} val 
     */
    visibleChange(val) {
      if (val == false) { //下拉收起时，若select里为空，置为'全部'
        if (this.multi_select_show_label.length < 1) {
          this.oldSearchPlat = [];
          this.changeSelect('全部')
        }
      }
    },

    /**
     * 格式化公司列表
     * @param  datas 
     */
    formatCompanyData(datas) {
      var unshift_data = {
        value: "全部",
        label: "全部",
      };
      var bear_obj = {};
      var bear_arr = [];
      var out_arr = {};
      for (var i = 0; i < datas.length; i++) {
        bear_obj = {
          value: datas[i].code,
          label: datas[i].sname,
        };
        bear_arr.push(bear_obj);
      }
      bear_arr.unshift(unshift_data);
      out_arr = {
        datas: bear_arr,
      };
      return out_arr;
    },


